import React from "react";
import ReactDOM from "react-dom";

class Kompo extends React.Component {
  constructor(props) {
    super(props);
    this.state = {
      text: ""
    };
  }

  render() {
    const style = {
      background: "red",
      fontSize: "5px",
      marginTop: "0px"
    };
    return (
      <Breadcrumb>
        <Breadcrumb.Item href="#">Home</Breadcrumb.Item>
        <Breadcrumb.Item href="http://getbootstrap.com/components/#breadcrumbs">
          Library
        </Breadcrumb.Item>
        <Breadcrumb.Item active>Data</Breadcrumb.Item>
      </Breadcrumb>
    );
  }
}

ReactDOM.render(<Kompo />, document.getElementById("root"));
